import logo from './logo.svg';
import './App.css';
import { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [users, setUsers] = useState([])

  useEffect(() => {
    const getUsers = async () => {
      const response = await axios('http://0.0.0.0:8080/users?access_token=eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY2MTBmYzI5ZmQ0Zjk3M2ZhMWJlODQzMiIsImlhdCI6MTcxMjM5MjcwOCwiZXhwIjoxNzEyMzk2MzA4fQ.ziBqYeKs5XALQzcNo_DexWRIv3mIvTpwIDkT3R76LaA')
      setUsers(response.data)
    }
    getUsers() 
  }, [])

  return (
    <div className="App">
      <header className="App-header">
        <button>新建</button>
        <table>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Role</th>
            <th>Action</th>
          </tr>
          <tr>
            <td>{users?.[0]?.id}</td>
            <td>{users?.[0]?.name}</td>
            <td>{users?.[0]?.role}</td>
            <td><button>Delete</button></td>
          </tr>
          <tr>
            <td>{users?.[1]?.id}</td>
            <td>{users?.[1]?.name}</td>
            <td>{users?.[1]?.role}</td>
          </tr>
          <tr>
            <td>{users?.[2]?.id}</td>
            <td>{users?.[2]?.name}</td>
            <td>{users?.[2]?.role}</td>
          </tr>
        </table>
      </header>
    </div>
  );
}

export default App;
